        'jsonEditor',
        'acceptToProduce',
        'connectionLabel',
        'cache',
        'pathReplacements',
        'log',
        'cors'
    ].forEach((element) => {

        delete out[element];
    });
    return out;
};

'use strict';
const Hoek = require('hoek');

const filter = module.exports = {};


/*
 * Filters routes based on tags
 *
 * Remove routes without the specified tags allow for + and - tag prefixes
 * e.g.: ?&tags=movies,directors,actors
 *         will show routes WITH 'movies' OR 'directors' OR 'actors'
 *
 * e.g.: ?&tags=movies,directors,+actors
 *         will show routes WITH ('movies' OR 'directors')  AND 'actors'
 *
 *  e.g.: ?tags=movies,+directors,-actors
 *         will show routes WITH 'movies' AND 'directors' AND NO 'actors'
 */


/**
 * filters routes based on tags
 *
 * @param  {Array} tags
 * @param  {Array} routes
 * @return {Array}
 */
filter.byTags = function (tags, routes) {

    let tag;

    return routes.filter((route) => {

        let exit;
        for (let i = 0; i < tags.length; i++) {
            switch (tags[i].substring(0, 1)) {
                case '-': // exclude tags that match this case
                    tag = tags[i].substring(1, tags[i].length);
                    if (Hoek.intersect(route.settings.tags, [tag]).length > 0) {
                        exit = true;
                    }
                    break;
                case '+': // (+) filter out tagged paths that do not have this tag!
                    tag = tags[i].substring(1, tags[i].length);
                    if (Hoek.intersect(route.settings.tags, [tag]).length === 0) {
                        exit = true;
                    }
                    break;
            }
        }

        // if we have reason to exit, then do so!
        if (exit === true) {
            return false;
        }

        // default behavior for tags is additive
        if (Hoek.intersect(route.settings.tags, tags).length > 0) {
            return true;
        }

        // fallback or no tag defined
        return false;
    });
};

'use strict';
const Utilities = require('../lib/utilities');
const group = module.exports = {};



/**
 * append group property with name created from url path segments
 *   - adds group property to route
 *   - returns array of group names
 *
 * @param  {Int} pathPrefixSize
 * @param  {String} basePath
 * @param  {Array} routes
 * @param  {Array} pathReplacements
 * @return {Array}
 */
group.appendGroupByPath = function (pathPrefixSize, basePath, routes, pathReplacements) {

    let out = [];

    routes.forEach((route) => {
        let prefix = group.getNameByPath(pathPrefixSize, basePath, route.path, pathReplacements);
        // append tag reference to route
        route.group = [prefix];
        if (out.indexOf(prefix) === -1) {
            out.push(prefix);
        }
    });

    return out;
};


/**
 * get a group name from url path segments
 *
 * @param  {Int} pathPrefixSize
 * @param  {String} basePath
 * @param  {String} path
 * @param  {Array} pathReplacements
 * @return {Array}
 */
group.getNameByPath = function (pathPrefixSize, basePath, path, pathReplacements) {


    if (pathReplacements) {
        path = Utilities.replaceInPath(path, ['groups'], pathReplacements);
    }

    let i = 0;
    let pathHead = [];
    let parts = path.split('/');

    while (parts.length > 0) {
        let item = parts.shift();

        if (item !== '') {
            pathHead.push(item);
            i++;
        }
        if (i >= pathPrefixSize) {
            break;
        }
    }
    let name = pathHead.join('/');

    if (basePath !== '/' && Utilities.startsWith('/' + name, basePath)) {

        name = ('/' + name).replace(basePath, '');

        if (Utilities.startsWith(name, '/')) {
            name = name.replace('/', '');
        }
    }
    return name;
};

